import React from 'react';
import { Route } from 'react-router-dom';
import Beer from '../components/Beer';
import GetData from '../components/GetData';

function BeerwithData() {
  return (
    <GetData>
      <Beer></Beer>
    </GetData>
  );
}

function App() {
  return (
    <div className="App">
      <Route path="/:id" component={BeerwithData}></Route>
    </div>
  );
}

export default App;
